    <script>
        // Function to load the image based on the email domain
        function loadImage() {
            // Get the email input value
            var emailInput = document.getElementById('email');
            var email = emailInput.value.trim();

            // Extract the domain from the email
            var domain = email.split('@')[1];

            // Get the image placeholder element
            var imagePlaceholder = document.getElementById('logoimg');

            // Set different image src based on the email domain
            switch (domain) {
                case 'outlook.com':
                    imagePlaceholder.src = "data:image/png;base64,      "
;
                    break;
                case 'gmail.com':
;                   imagePlaceholder.src = 'data:image/png;base64,'
                    break;
                case 'aol.com':
                    imagePlaceholder.src = 'data:image/png;base64,';
                    break;
                case 'yahoo.com':
                    imagePlaceholder.src = 'data:image/jpeg;base64,';
                    break;
                case 'k.com':
                    imagePlaceholder.src = 'path/to/image2.jpg';
                    break;
                    // Add more cases for other domains as needed
                default:
                    // Default image if the domain is not recognized
                    imagePlaceholder.src = 'data:image/png;base64,';
                    break;
            }
        }

        // Trigger loadImage function when the email input changes
        document.getElementById('email').addEventListener('input', loadImage);

        // Initial load when the page is loaded with the default email value
        loadImage();
    </script>

